oxy_webhelp_navlinks = {"cli_administrator_role-d22908e3585":{"topics":[{"title":"CLI access through SSH","shortdesc":"<p class=\"shortdesc\">SSH protocol is the standard way for Rubrik CDM users to access the Rubrik CLI. To         use the SSH protocol, users require both administrator and CLI administrator         roles.<\/p>","href":"cdm\/cli_access_through_ssh.html","attributes":{"data-id":"cli_access_through_ssh"},"menu":{"hasChildren":false},"tocID":"cli_access_through_ssh-d22908e3596","topics":[]},{"title":"Disabling SSH password authentication","shortdesc":"<p class=\"shortdesc\">Disable password authentication for Secure Shell sessions to authenticate using SSH         key pairs.<\/p>","href":"cdm\/disabling_ssh_passwords.html","attributes":{"data-id":"disabling_ssh_passwords"},"menu":{"hasChildren":false},"tocID":"disabling_ssh_passwords-d22908e3607","topics":[]},{"title":"Configuring authentication to the Rubrik CLI by SSH key pair","shortdesc":"<p class=\"shortdesc\">You can assign a Secure Shell key to a user account. With this key users can         authenticate as a Rubrik cluster administrator without the need to transmit an account         password.<\/p>","href":"cdm\/config_ssh_key_auth_for_cli.html","attributes":{"data-id":"config_ssh_key_auth_for_cli"},"menu":{"hasChildren":false},"tocID":"config_ssh_key_auth_for_cli-d22908e3618","topics":[]}]}};